import React from 'react';
import { NavLink } from 'react-router-dom';

export default function Navbar_settings() {
    return (
        <nav className="navbar-settings">
            <NavLink to="/settings/accounts">
                <li className="s-li" activeClassName="s-li-active">Accounts</li>
            </NavLink>
            <NavLink to="/settings/logout">
                <li className="s-li" activeClassName="s-li-active">Logout</li>
            </NavLink>
            <NavLink to="/settings/darkmode">
                <li className="s-li" activeClassName="s-li-active">Dark Mode</li>
            </NavLink>
        </nav>
    );
}
